import React, { Component } from "react";
import Head from "../header";
import { BrowserRouter as Router, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
// import Image1 from "./img/blogging-336376_1920.jpg";
import "./CSS/blog.css";
import Footer from "../footer";
import AOS from "aos";
import "aos/dist/aos.css";
import Preloader from "../preloader";
import { useState, useEffect } from "react";
const axios = require("axios").default;

function Blog() {
  AOS.init();

  // var state = {
  //   data : "",
  //   pos : 0
  // };

  const urlLink = "http://localhost:5000/blog/fetchAll";

  const dataObject = {};

  const BlogFetch = () => {
    return new Promise((resolve, reject) => {
      axios({
        method: "POST",

        url: urlLink,

        data: dataObject
      })
        .then(function(response) {
          resolve(response.data.data);
          // state.data = response.data.data;
          // state.pos = 1;
        })
        .catch(function(err) {
          console.log("error");
        });
    });
  };

  // const sendGetRequest = async() => {
  //   let awaiting = await BlogFetch();

  //   // return (awaiting);

  //   console.log(awaiting);
  //   // function test(params) {
  //   //   console.log("yeaa");
  //   // }
  // };

  // sendGetRequest()

  const [isFetching, setIsFetching] = useState(false);
  const [dataFetched, setDataFetched] = useState(null);
  useEffect(() => {
    (async () => {
      setIsFetching(true);
      const data = await BlogFetch();
      setDataFetched(data);
      setIsFetching(false);
    })();
  }, []);

  if(isFetching) return <p>Is Fetching</p>

  const BlogPost1 = [
    {
      dev: 1
    },
    {
      dev: 2
    },
    {
      dev: 3
    },
    {
      dev: 3
    },
    {
      dev: 3
    },
    {
      dev: 3
    },
    {
      dev: 3
    }
  ];
  // console.log(BlogPost1);
  document.title = "Darkbank | Blog";

  return (
    <div>
      <Preloader />
      <Head />
      {/* {sendGetRequest.map(posts => ( 
        <div>test</div>
      ))} */}
      <div>
        <div className="about-container">
          <div className="blog-banner fadeIn">
            <div>
              <hr style={{ marginTop: "0em" }} />

              <div className="darkbank-logo">
                <img
                  src="https://darkbank.io/img/security-logo.png"
                  alt="DarkBank"
                  className="darkbank"
                />
              </div>

              <div className="blogus">BLOG</div>
              <div className="home-blogus">
                <span>HOME</span>
                <i
                  className="fa fa-angle-right"
                  style={{
                    marginLeft: "0.3em",
                    marginRight: "0.3em",
                    fontSize: "1.3em"
                  }}
                ></i>
                <span>BLOG</span>
              </div>
            </div>
          </div>

          <div
            className="container blog-cover"
            data-aos="flip-down-right"
            aos-duration="1500"
          >
            <div className="row mt-3">
              {/* {console.log(G)} */}

              {data.map(posts => (
                <div
                  className="col-sm-12 col-lg-6 col-xl-4 col-md-6 blog-inner"
                  data-aos="zoom-in"
                  data-aos-offset="100"
                  data-aos-easing="ease-in-sine"
                >
                  <div className="card">
                    <div className="col-sm-14 col-lg-14 col-xl-14 col-md-14">
                      <div className="images">
                        <img
                          src="https://res.cloudinary.com/dzflzvx3h/image/upload/v1597163421/darkbank/blog/blogging-336376_1920_nqzfq8.jpg"
                          className="blog"
                        />
                      </div>
                    </div>
                    <div className="col-sm-12 col-lg-12 col-xl-12 col-md-12">
                      <div className="card-inner">
                        <div className="header">
                          <h5 className="blog-title"></h5>
                          <span className="blog-date">
                            <i className="fa fa-calendar icon-blog"></i>
                            22/08/2020
                          </span>
                          <span className="blog-poster">
                            <i className="fa fa-user icon-blog"></i> BY ADMIN
                          </span>
                        </div>
                        <div className="blog-content">
                          <p>
                            Lorem Ipsum just for testing and testing and testing
                            annd testing
                          </p>
                        </div>
                        <div className="readMore">
                          <Link to="" className="read">
                            READ MORE
                          </Link>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default Blog;
